script: |
  super -f text -I q1453.spq | sort > q1453.out

inputs:
  - name: q1453.spq
    data: |
      SELECT DISTINCT + col2 * - - ( - col2 ) + + col1 + + - col2 - col1 AS col0, col0 * - - col0 * - ( col1 ) FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q1453.out
    data: |
      -3540	-36125
      -4692	-389207
      -9312	-36414
